INSERT INTO `mail_tbls` (`id`, `application_form_id`, `sender_id`, `user_id`, `send_type`, `mail_send_date`, `mail_body`, `mail_seen`, `mail_read`, `created_at`, `updated_at`) VALUES
(1, 4, 1, 1, 2, '2022-11-24 09:38:53', '<p>လူကြီးမင်း လျှောက်ထားသော အိမ်သုံးမီတာ ( လျှောက်လွှာအမှတ်စဉ်-<span class=\"text-danger\">MDY-1663122962</span> ) မှာ မြို့နယ်ရုံးမှ လက်ခံပြီးဖြစ်ကြောင်းနှင့် လုပ်ငန်းစဥ်အခြေအနေအား အောက်ပါ လင့်ခ်(Link)တဆင့် ဝင်ရောက်ကြည့်ရှုနိုင်ပါကြောင်း အကြောင်းကြားပါသည်။</p><div class=\"text-center mt-5 mb-5\"><a href=\"http://eformexample.moee.gov.mm/residentialMeterMandalayAppliedForm/4\" class=\"btn btn-info text-center\">Go to Form</a></div>', 0, 0, '2022-11-24 09:38:53', '2022-11-24 09:38:53'),
(2, 4, 1, 1, 5, '2022-11-24 09:44:53', '<p>လူကြီးမင်း လျှောက်ထားသော အိမ်သုံးမီတာ ( လျှောက်လွှာအမှတ်စဉ်-<span class=\"text-danger\">MDY-1663122962</span> ) မှာ ငွေသွင်းရန်အဆင့်သို့ ရောက်ရှိနေပြီဖြစ်ပါသောကြောင့် လျှောက်လွှာအတွင်းပါရှိသော အထောက်အထားများ၏ မူရင်းများကို တပါတည်းယူဆောင်၍ သက်မှတ်ရက် ( <span class=\"text-danger\">01-12-2022</span> )ထက်နောက်မကျစေဘဲ ရုံးသို့ လူကိုယ်တိုင် လာရောက် ငွေသွင်းနိုင်ပြီဖြစ်ကြောင်း အကြောင်းကြားပါသည်။</p>', 0, 0, '2022-11-24 09:44:53', '2022-11-24 09:44:53'),
